import './date.css';

function date() {
  return (
    <div className="date">
 <div className="card-date">
        <p className="material-text-date"><span>اللغة العربية</span><span className="time-sub-text-date">  11:00</span></p>
        <p className="day-text-date">السبت 27 يناير</p>
      </div>
    </div>
  );
}

export default date;
